import React, { useState } from "react";
import {
  StyleSheet,
  Text,
  View,
  TouchableOpacity,
  TextInput,
  ScrollView,
  Image,
} from "react-native";
import { LinearGradient } from "expo-linear-gradient";

const skillsimages = [require("../assets/notification.png")];

export default function ChooseInterestsScreen(props) {
  return (
    <LinearGradient colors={["#FFE9E4", "#ff2e00"]} style={styles.container}>
      <Text style={styles.toptext}>Choose your skills!</Text>
      <View style={styles.searchbar}>
        <TextInput
          style={{ color: "#290907", textAlign: "center", fontSize: 20 }}
          placeholder="Search..."
          placeholderTextColor="#290907"
        ></TextInput>
      </View>

      <View style={{ height: 400 }}>
        <ScrollView>
          {skillsimages.map((ref) => {
            return <Image source={ref}></Image>;
          })}
        </ScrollView>
      </View>

      <View style={{ paddingTop: 20 }}>
        <TouchableOpacity
          onPress={() => {
            props.navigation.navigate("Home");
          }}
        >
          <Text
            style={{
              color: "#290907",
              fontSize: 16,
              textDecorationLine: "underline",
            }}
          >
            Skip
          </Text>
        </TouchableOpacity>
      </View>
    </LinearGradient>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  toptext: {
    color: "#290907",
    fontSize: 36,
    justifyContent: "center",
    paddingBottom: 10,
  },
  searchbar: {
    justifyContent: "center",
    backgroundColor: "white",
    width: 300,
    height: 40,
    borderRadius: 15,
    margin: 10,
  },
});
